INSERT INTO `categories` (`id`, `entity_id`, `category_type`, `name`, `descriptions`, `destroyed_at`, `deleted_at`, `created_at`, `updated_at`) VALUES
	(5, 1, 'CURRENT_ASSET', 'Asset Accounts', NULL, NULL, '2022-06-24 12:53:24', '2022-04-09 13:35:15', '2022-06-24 12:53:24'),
	(9, 1, 'CURRENT_LIABILITY', 'Liability Accounts', NULL, NULL, NULL, '2022-04-09 13:36:44', '2022-07-09 01:56:53'),
	(12, 1, 'OPERATING_REVENUE', 'Discounts/Refunds Given', 'Use Discounts/refunds given to track discounts you give to customers.\nThis account typically has a negative balance so it offsets other income.\n\nFor discounts from vendors, use an expense account, instead.', NULL, NULL, '2022-04-09 13:38:08', '2022-06-24 22:09:29'),
	(14, 1, 'OPERATING_REVENUE', 'Non-Operations Accounts', 'Use Non-profit income to track money coming in if you are a non-profit organization.', NULL, '2022-06-24 22:11:25', '2022-04-09 13:39:21', '2022-06-24 22:11:25'),
	(18, 1, 'RECONCILIATION', 'Miscellaneous Accounts', NULL, NULL, NULL, '2022-04-09 13:42:14', '2022-04-09 13:42:14'),
	(19, 1, 'BANK', 'Cash on hand', 'Use a Cash on hand account to track cash your company keeps for occasional expenses, also called petty cash.\nTo track cash from sales that have not been deposited yet, use a pre-created account called Undeposited funds, instead.', NULL, NULL, '2022-05-16 00:01:07', '2022-06-24 12:54:39'),
	(20, 1, 'BANK', 'Checking', 'Use Checking accounts to track all your checking activity, including debit card transactions.\nEach checking account your company has at a bank or other financial institution should have its own Checking type account in QuickBooks Online Advanced.', NULL, NULL, '2022-05-16 00:02:06', '2022-06-24 12:54:48'),
	(21, 1, 'BANK', 'Money Market', 'Use Money market to track amounts in money market accounts.\nFor investments, see Other Current Assets, instead.', NULL, NULL, '2022-05-16 00:02:27', '2022-06-24 12:54:57'),
	(22, 1, 'BANK', 'Rents Held in Trust', 'Use Rents held in trust to track deposits and rent held on behalf of the property owners.\nTypically only property managers use this type of account.', NULL, NULL, '2022-05-16 00:02:39', '2022-06-24 12:55:06'),
	(23, 1, 'BANK', 'Savings', 'Use Savings accounts to track your savings and CD activity.\nEach savings account your company has at a bank or other financial institution should have its own Savings type account.\n\nFor investments, see Other Current Assets, instead.', NULL, NULL, '2022-05-16 00:02:53', '2022-06-24 12:55:15'),
	(24, 1, 'BANK', 'Trust account', 'Use Trust accounts for money held by you for the benefit of someone else.\nFor example, trust accounts are often used by attorneys to keep track of expense money their customers have given them.\n\nOften, to keep the amount in a trust account from looking like it’s yours, the amount is offset in a "contra" liability account (a Current Liability).', NULL, NULL, '2022-05-16 00:03:07', '2022-06-24 12:55:27'),
	(25, 1, 'CONTRA_ASSET', 'Accumulated Amortization of Other Assets', 'Use Accumulated amortization of other assets to track how much you’ve amortized asset whose type is Other Asset.', NULL, NULL, '2022-05-16 00:04:55', '2022-06-24 12:29:24'),
	(26, 1, 'CONTRA_ASSET', 'Accumulated Depletion', NULL, NULL, '2022-06-24 12:41:07', '2022-05-16 00:05:17', '2022-06-24 12:41:07'),
	(27, 1, 'CONTRA_ASSET', 'Accumulated Depreciation', NULL, NULL, '2022-06-24 12:41:11', '2022-05-16 00:05:30', '2022-06-24 12:41:11'),
	(28, 1, 'CURRENT_ASSET', 'Buildings', NULL, NULL, '2022-06-24 12:53:18', '2022-05-16 00:05:44', '2022-06-24 12:53:18'),
	(29, 1, 'CURRENT_ASSET', 'Depletable Assets', NULL, NULL, '2022-06-24 12:53:31', '2022-05-16 00:05:56', '2022-06-24 12:53:31'),
	(30, 1, 'CURRENT_ASSET', 'Fixed Asset Computers', NULL, NULL, '2022-06-24 12:51:35', '2022-05-16 00:06:09', '2022-06-24 12:51:35'),
	(31, 1, 'CURRENT_ASSET', 'Fixed Asset Copiers', NULL, NULL, '2022-06-24 12:53:51', '2022-05-16 00:06:24', '2022-06-24 12:53:51'),
	(32, 1, 'CURRENT_ASSET', 'Fixed Asset Furniture', NULL, NULL, '2022-06-24 12:53:34', '2022-05-16 00:06:37', '2022-06-24 12:53:34'),
	(33, 1, 'CURRENT_ASSET', 'Fixed Asset Other Tools Equipment', NULL, NULL, '2022-06-24 12:53:37', '2022-05-16 00:06:52', '2022-06-24 12:53:37'),
	(34, 1, 'CURRENT_ASSET', 'Fixed Asset Phone', NULL, NULL, '2022-06-24 12:53:42', '2022-05-16 00:07:05', '2022-06-24 12:53:42'),
	(35, 1, 'CURRENT_ASSET', 'Fixed Asset Photo Video', NULL, NULL, '2022-06-24 12:53:45', '2022-05-16 00:07:17', '2022-06-24 12:53:45'),
	(36, 1, 'CURRENT_ASSET', 'Fixed Asset Software', NULL, NULL, '2022-06-24 12:53:48', '2022-05-16 00:07:33', '2022-06-24 12:53:48'),
	(37, 1, 'CURRENT_ASSET', 'Furniture & Fixtures', NULL, NULL, '2022-06-24 12:53:55', '2022-05-16 00:07:45', '2022-06-24 12:53:55'),
	(38, 1, 'CURRENT_ASSET', 'Intangible Assets', NULL, NULL, '2022-06-24 12:54:00', '2022-05-16 00:07:57', '2022-06-24 12:54:00'),
	(39, 1, 'CURRENT_ASSET', 'Land', NULL, NULL, '2022-06-24 12:54:05', '2022-05-16 00:08:10', '2022-06-24 12:54:05'),
	(40, 1, 'CURRENT_ASSET', 'Leasehold Improvements', NULL, NULL, '2022-06-24 12:54:08', '2022-05-16 00:08:23', '2022-06-24 12:54:08'),
	(41, 1, 'CURRENT_ASSET', 'Machinery & Equipment', NULL, NULL, '2022-06-24 12:54:11', '2022-05-16 00:08:35', '2022-06-24 12:54:11'),
	(42, 1, 'CURRENT_ASSET', 'Other fixed assets', NULL, NULL, '2022-06-24 12:54:15', '2022-05-16 00:08:47', '2022-06-24 12:54:15'),
	(43, 1, 'CURRENT_ASSET', 'Vehicles', NULL, NULL, '2022-06-24 12:53:06', '2022-05-16 00:08:59', '2022-06-24 12:53:06'),
	(44, 1, 'CONTRA_ASSET', 'Accumulated Amortization of Other Assets', NULL, NULL, '2022-06-24 12:36:31', '2022-05-16 00:09:31', '2022-06-24 12:36:31'),
	(45, 1, 'CONTRA_ASSET', 'Goodwill', 'Use Goodwill only if you have acquired another company. It represents the intangible assets of the acquired company which gave it an advantage, such as favorable government relations, business name, outstanding credit ratings, location, superior management, customer lists, product quality, or good labor relations.', NULL, NULL, '2022-05-16 00:09:45', '2022-06-24 12:21:57'),
	(46, 1, 'CONTRA_ASSET', 'Lease Buyout', 'Use Lease buyout to track lease payments to be applied toward the purchase of a leased asset.\nYou don’t track the leased asset itself until you purchase it.', NULL, NULL, '2022-05-16 00:09:56', '2022-06-24 12:22:33'),
	(47, 1, 'CONTRA_ASSET', 'Licenses', 'Use Licenses to track non-professional licenses for permission to engage in an activity, like selling alcohol or radio broadcasting.\nFor fees associated with professional licenses granted to individuals, use a Legal & professional fees expense account, instead.', NULL, NULL, '2022-05-16 00:10:08', '2022-06-24 12:22:48'),
	(48, 1, 'CONTRA_ASSET', 'Organizational Costs', 'Use Organizational costs to track costs incurred when forming a partnership or corporation.\nThe costs include the legal and accounting costs necessary to organize the company, facilitate the filings of the legal documents, and other paperwork.', NULL, NULL, '2022-05-16 00:11:13', '2022-06-24 12:39:09'),
	(49, 1, 'CURRENT_ASSET', 'Other Long-term Assets', NULL, NULL, '2022-06-24 12:53:01', '2022-05-16 00:11:38', '2022-06-24 12:53:01'),
	(50, 1, 'CONTRA_ASSET', 'Security Deposits', 'Use Security deposits to track funds you’ve paid to cover any potential costs incurred by damage, loss, or theft.\nThe funds should be returned to you at the end of the contract.\n\nIf you collect deposits, use an Other current liabilities account type (an Other current liability account).', NULL, NULL, '2022-05-16 00:12:16', '2022-06-24 12:25:29'),
	(51, 1, 'RECEIVABLE', 'Accounts Receivable (A/R)', 'Accounts receivable (also called A/R, Debtors, or Trade and other receivables) tracks money that customers owe you for products or services, and payments customers make.\nQuickBooks Online Advanced automatically creates one Accounts receivable account for you. Most businesses need only one.\n\nEach customer has a register, which functions like an Accounts receivable account for each customer.', NULL, NULL, '2022-05-16 00:28:03', '2022-06-24 11:39:45'),
	(52, 1, 'PAYABLE', 'Accounts Payable (A/P)', 'Accounts payable (also called A/P) tracks amounts you owe to your vendors and suppliers.\nQuickBooks Online Advanced automatically creates one Accounts Payable account for you. Most businesses need only one.', NULL, NULL, '2022-05-16 00:28:22', '2022-06-24 23:51:42'),
	(53, 1, 'NON_CURRENT_LIABILITY', 'Deferred Revenue', NULL, NULL, NULL, '2022-05-16 00:46:13', '2022-05-16 00:46:13'),
	(54, 1, 'NON_CURRENT_LIABILITY', 'Federal Income Tax Payable', 'Use Federal Income Tax Payable if your business is a corporation, S corporation, or limited partnership keeping records on the accrual basis.\nThis account tracks income tax liabilities in the year the income is earned.', NULL, NULL, '2022-05-16 00:47:47', '2022-06-24 12:57:03'),
	(55, 1, 'NON_CURRENT_LIABILITY', 'Insurance Payable', 'Use Insurance payable to keep track of insurance amounts due.\nThis account is most useful for businesses with monthly recurring insurance expenses such as Workers’ Compensation.', NULL, NULL, '2022-05-16 00:48:00', '2022-06-24 12:57:49'),
	(56, 1, 'NON_CURRENT_LIABILITY', 'Line of Credit', 'Use Line of credit to track the balance due on any lines of credit your business has. Each line of credit your business has should have its own Line of credit account.', NULL, NULL, '2022-05-16 00:48:14', '2022-06-24 12:58:04'),
	(57, 1, 'NON_CURRENT_LIABILITY', 'Loan Payable', 'Use Loan payable to track loans your business owes which are payable within the next twelve months.\nFor longer-term loans, use the Long-term liability called Notes payable, instead.', NULL, NULL, '2022-05-16 00:48:29', '2022-06-24 12:58:23'),
	(58, 1, 'NON_CURRENT_LIABILITY', 'Other Current Liabilities', 'Use Other current liabilities to track liabilities due within the next twelve months that do not fit the Other current liability account types.', NULL, NULL, '2022-05-16 00:49:10', '2022-06-24 12:58:34'),
	(59, 1, 'NON_CURRENT_LIABILITY', 'Payroll Clearing', 'Use Payroll clearing to keep track of any non-tax amounts that you have deducted from employee paychecks or that you owe as a result of doing payroll. When you forward money to the appropriate vendors, deduct the amount from the balance of this account.\nDo not use this account for tax amounts you have withheld or owe from paying employee wages. For those amounts, use the Payroll tax payable account instead.', NULL, NULL, '2022-05-16 00:49:37', '2022-06-24 12:59:35'),
	(60, 1, 'CONTROL', 'Payroll Tax Payable', 'Use Payroll tax payable to keep track of tax amounts that you owe to Federal, State, and Local government agencies as a result of paying wages and taxes you have withheld from employee paychecks. When you forward the money to the government agency, deduct the amount from the balance of this account.', NULL, NULL, '2022-05-16 00:49:58', '2022-06-24 23:53:11'),
	(61, 1, 'NON_CURRENT_LIABILITY', 'Prepaid Expenses Payable', 'Use Prepaid expenses payable to track items such as property taxes that are due, but not yet deductible as an expense because the period they cover has not yet passed.', NULL, NULL, '2022-05-16 00:50:18', '2022-06-24 13:00:37'),
	(62, 1, 'NON_CURRENT_LIABILITY', 'Rents in trust - Liability', 'Use Rents in trust - liability to offset the Rents in trust amount in assets.\nAmounts in these accounts are held by your business on behalf of others. They do not belong to your business, so should not appear to be yours on your balance sheet. This "contra" account takes care of that, as long as the two balances match.', NULL, NULL, '2022-05-16 00:50:34', '2022-06-24 13:00:57'),
	(63, 1, 'CONTROL', 'Sales Tax Payable', 'Use Sales tax payable to track sales tax you have collected, but not yet remitted to the IRS.', NULL, NULL, '2022-05-16 00:50:49', '2022-06-24 23:53:30'),
	(64, 1, 'NON_CURRENT_LIABILITY', 'State/Local Income Tax Payable', 'Use State/local income tax payable if your business is a corporation, S corporation, or limited partnership keeping records on the accrual basis.\nThis account tracks income tax liabilities in the year the income is earned.', NULL, NULL, '2022-05-16 00:51:07', '2022-06-24 13:01:52'),
	(65, 1, 'NON_CURRENT_LIABILITY', 'Trust Accounts - Liabilities', 'Use Trust accounts - liabilities to offset Trust accounts in assets.\nAmounts in these accounts are held by your business on behalf of others. They do not belong to your business, so should not appear to be yours on your balance sheet. This "contra" account takes care of that, as long as the two balances match.', NULL, NULL, '2022-05-16 00:51:29', '2022-06-24 13:02:10'),
	(66, 1, 'NON_CURRENT_LIABILITY', 'Undistributed Tips', NULL, NULL, NULL, '2022-05-16 00:52:04', '2022-05-16 00:52:04'),
	(67, 1, 'NON_CURRENT_LIABILITY', 'Notes Payable', NULL, NULL, NULL, '2022-05-16 00:52:35', '2022-05-16 00:52:35'),
	(68, 1, 'NON_CURRENT_LIABILITY', 'Other Long Term Liabilities', NULL, NULL, NULL, '2022-05-16 00:52:48', '2022-05-16 00:52:48'),
	(69, 1, 'NON_CURRENT_LIABILITY', 'Shareholder Notes Payable', NULL, NULL, NULL, '2022-05-16 00:53:07', '2022-05-16 00:53:07'),
	(70, 1, 'EQUITY', 'Accumulated Adjustment', 'S corporations use this account to track adjustments to owner’s equity that are not attributable to net income.', NULL, NULL, '2022-05-16 00:56:01', '2022-06-24 13:03:27'),
	(71, 1, 'EQUITY', 'Common Stock', 'Corporations use Common stock to track shares of its common stock in the hands of shareholders. The amount in this account should be the stated (or par) value of the stock.', NULL, NULL, '2022-05-16 00:56:23', '2022-06-24 13:03:37'),
	(72, 1, 'EQUITY', 'Estimated Taxes', NULL, NULL, NULL, '2022-05-16 00:56:37', '2022-05-16 00:56:37'),
	(73, 1, 'EQUITY', 'Health Insurance Premium', NULL, NULL, NULL, '2022-05-16 00:56:54', '2022-05-16 00:56:54'),
	(74, 1, 'EQUITY', 'Health Savings Account Contribution', NULL, NULL, NULL, '2022-05-16 00:57:14', '2022-05-16 00:57:14'),
	(75, 1, 'EQUITY', 'Opening Balance Equity', 'QuickBooks Online Advanced creates this account the first time you enter an opening balance for a balance sheet account.\nAs you enter opening balances, QuickBooks Online Advanced records the amounts in Opening balance equity. This ensures that you have a correct balance sheet for your company, even before you’ve finished entering all your company’s assets and liabilities.', NULL, NULL, '2022-05-16 00:57:38', '2022-06-24 13:03:53'),
	(76, 1, 'EQUITY', 'Owner\'s Equity', 'S corporations use Owner’s equity to show the cumulative net income or loss of their business as of the beginning of the fiscal year.', NULL, NULL, '2022-05-16 00:58:02', '2022-06-24 13:04:04'),
	(77, 1, 'EQUITY', 'Paid-In Capital or Surplus', 'Corporations use Paid-in capital to track amounts received from shareholders in exchange for stock that are over and above the stock’s stated (or par) value.', NULL, NULL, '2022-05-16 00:58:22', '2022-06-24 13:04:17'),
	(78, 1, 'EQUITY', 'Partner Contributions', 'Partnerships use Partner contributions to track amounts partners contribute to the partnership during the year.', NULL, NULL, '2022-05-16 00:58:41', '2022-06-24 13:04:28'),
	(79, 1, 'EQUITY', 'Partner Distributions', 'Partnerships use Partner distributions to track amounts distributed by the partnership to its partners during the year.\nDon’t use this for regular payments to partners for interest or service. For regular payments, use a Guaranteed payments account (a Expense account in Payroll expenses), instead.', NULL, NULL, '2022-05-16 00:58:54', '2022-06-24 13:04:42'),
	(80, 1, 'EQUITY', 'Partner\'s Equity', 'Partnerships use Partner’s equity to show the income remaining in the partnership for each partner as of the end of the prior year.', NULL, NULL, '2022-05-16 00:59:14', '2022-06-24 13:04:53'),
	(81, 1, 'EQUITY', 'Personal Expense', NULL, NULL, NULL, '2022-05-16 00:59:31', '2022-05-16 00:59:31'),
	(82, 1, 'EQUITY', 'Personal Income', NULL, NULL, NULL, '2022-05-16 00:59:49', '2022-05-16 00:59:49'),
	(83, 1, 'EQUITY', 'Preferred Stock', 'Corporations use this account to track shares of its preferred stock in the hands of shareholders. The amount in this account should be the stated (or par) value of the stock.', NULL, NULL, '2022-05-16 01:00:15', '2022-06-24 13:05:11'),
	(84, 1, 'EQUITY', 'Retained Earnings', 'Retained earnings tracks net income from previous fiscal years.\n\nQuickBooks Online Advanced automatically transfers your profit (or loss) to Retained earnings at the end of each fiscal year.', NULL, NULL, '2022-05-16 01:00:30', '2022-06-24 13:05:38'),
	(85, 1, 'EQUITY', 'Treasury Stock', 'Corporations use Treasury stock to track amounts paid by the corporation to buy its own stock back from shareholders.', NULL, NULL, '2022-05-16 01:00:45', '2022-06-24 13:05:52'),
	(86, 1, 'NON_OPERATING_REVENUE', 'Discounts/Refunds Given', NULL, NULL, '2022-06-24 22:10:11', '2022-05-16 01:01:34', '2022-06-24 22:10:11'),
	(87, 1, 'NON_OPERATING_REVENUE', 'Non-Profit Income', 'Use Non-profit income to track money coming in if you are a non-profit organization.', NULL, NULL, '2022-05-16 01:01:52', '2022-06-24 22:14:29'),
	(88, 1, 'OPERATING_REVENUE', 'Other Primary Income', 'Use Other primary income to track income from normal business operations that doesn’t fall into another Income type.', NULL, NULL, '2022-05-16 01:02:05', '2022-06-24 22:11:54'),
	(89, 1, 'OPERATING_REVENUE', 'Sales of Product Income', 'Use Sales of product income to track income from selling products.\nThis can include all kinds of products, like crops and livestock, rental fees, performances, and food served.', NULL, NULL, '2022-05-16 01:02:21', '2022-06-24 22:12:16'),
	(90, 1, 'OPERATING_REVENUE', 'Service/Fee Income', 'Use Service/fee income to track income from services you perform or ordinary usage fees you charge.\nFor fees customers pay you for late payments or other uncommon situations, use an Other Income account type called Other miscellaneous income, instead.', NULL, NULL, '2022-05-16 01:02:35', '2022-06-24 22:12:34'),
	(91, 1, 'OPERATING_REVENUE', 'Unapplied Cash Payment Income', 'Unapplied Cash Payment Income reports the Cash Basis income from customers payments you’ve received but not applied to invoices or charges. In general, you would never use this directly on a purchase or sale transaction. The IRS calls this "Constructive Receipt Income." See Publication 538.', NULL, NULL, '2022-05-16 01:02:47', '2022-06-24 22:12:48'),
	(92, 1, 'NON_OPERATING_REVENUE', 'Dividend Income', 'Use Dividend income to track taxable dividends from investments.', NULL, NULL, '2022-05-16 01:03:15', '2022-06-24 22:13:06'),
	(93, 1, 'NON_OPERATING_REVENUE', 'Interest Earned', 'Use Interest earned to track interest from bank or savings accounts, investments, or interest payments to you on loans your business made.', NULL, NULL, '2022-05-16 01:03:27', '2022-06-24 22:13:25'),
	(94, 1, 'NON_OPERATING_REVENUE', 'Other Investment Income', 'Use Other investment income to track other types of investment income that isn’t from dividends or interest.', NULL, NULL, '2022-05-16 01:03:41', '2022-06-24 22:13:38'),
	(95, 1, 'NON_OPERATING_REVENUE', 'Other Miscellaneous Income', 'Use Other miscellaneous income to track income that isn’t from normal business operations, and doesn’t fall into another Other Income type.', NULL, NULL, '2022-05-16 01:03:52', '2022-06-24 22:13:50'),
	(96, 1, 'NON_OPERATING_REVENUE', 'Tax-Exempt Interest', 'Use Tax-exempt interest to record interest that isn’t taxable, such as interest on money in tax-exempt retirement accounts, or interest from tax-exempt bonds.', NULL, NULL, '2022-05-16 01:04:09', '2022-06-24 22:14:01'),
	(97, 1, 'OPERATING_EXPENSE', 'Cost of labor - COS', 'Use Cost of labor - COS to track the cost of paying employees to produce products or supply services.\nIt includes all employment costs, including food and transportation, if applicable.', NULL, NULL, '2022-05-16 01:06:53', '2022-06-24 22:16:51'),
	(98, 1, 'OPERATING_EXPENSE', 'Equipment Rental - COS', 'Use Equipment rental - COS to track the cost of renting equipment to produce products or services.\nIf you purchase equipment, use a Fixed Asset account type called Machinery and equipment.', NULL, NULL, '2022-05-16 01:07:08', '2022-06-24 22:17:23'),
	(99, 1, 'OPERATING_EXPENSE', 'Other Costs of Services - COS', 'Use Other costs of service - COS to track costs related to services you provide that don’t fall into another Cost of Goods Sold type.', NULL, NULL, '2022-05-16 01:07:26', '2022-06-24 22:17:47'),
	(100, 1, 'OPERATING_EXPENSE', 'Shipping, Freight & Delivery - COS', 'Use Shipping, freight & delivery - COGS to track the cost of shipping products to customers or distributors.', NULL, NULL, '2022-05-16 01:07:40', '2022-06-24 22:18:12'),
	(101, 1, 'OPERATING_EXPENSE', 'Supplies & Materials - COGS', 'Use Supplies & materials - COGS to track the cost of raw goods and parts used or consumed when producing a product or providing a service.', NULL, NULL, '2022-05-16 01:08:01', '2022-06-24 22:18:50'),
	(102, 1, 'DIRECT_EXPENSE', 'Advertising/Promotional', 'Use Advertising/promotional to track money spent promoting your company.\nYou may want different accounts of this type to track different promotional efforts (Yellow Pages, newspaper, radio, flyers, events, and so on).\n\nIf the promotion effort is a meal, use Promotional meals instead.', NULL, NULL, '2022-05-16 01:08:27', '2022-06-24 22:28:22'),
	(103, 1, 'DIRECT_EXPENSE', 'Auto', 'Use Auto to track costs associated with vehicles.\nYou may want different accounts of this type to track gasoline, repairs, and maintenance.\n\nIf your business owns a car or truck, you may want to track its value as a Fixed Asset, in addition to tracking its expenses.', NULL, NULL, '2022-05-16 01:08:39', '2022-06-24 22:28:42'),
	(104, 1, 'OTHER_EXPENSE', 'Bad Debts', 'Use Bad debt to track debt you have written off.', NULL, NULL, '2022-05-16 01:08:58', '2022-06-24 22:31:15'),
	(105, 1, 'OTHER_EXPENSE', 'Bad Debts', NULL, NULL, '2022-06-24 22:31:09', '2022-05-16 01:11:59', '2022-06-24 22:31:09'),
	(106, 1, 'OPERATING_EXPENSE', 'Bank Charges', 'Use Bank charges for any fees you pay to financial institutions.', NULL, NULL, '2022-05-16 01:12:15', '2022-06-24 22:31:34'),
	(107, 1, 'OTHER_EXPENSE', 'Charitable Contributions', 'Use Charitable contributions to track gifts to charity.', NULL, NULL, '2022-05-16 01:12:44', '2022-06-24 22:31:49'),
	(108, 1, 'OPERATING_EXPENSE', 'Communication', NULL, NULL, NULL, '2022-05-16 01:12:55', '2022-05-16 01:12:55'),
	(109, 1, 'OVERHEAD_EXPENSE', 'Cost of Labor', 'Use Cost of labor to track the cost of paying employees to produce products or supply services.\nIt includes all employment costs, including food and transportation, if applicable.\n\nThis account is also available as a Cost of Goods Sold (COGS) account.', NULL, NULL, '2022-05-16 01:13:08', '2022-06-24 22:32:31'),
	(110, 1, 'OTHER_EXPENSE', 'Dues & subscriptions', 'Use Dues & subscriptions to track dues & subscriptions related to running your business.\nYou may want different accounts of this type for professional dues, fees for licenses that can’t be transferred, magazines, newspapers, industry publications, or service subscriptions.', NULL, NULL, '2022-05-16 01:13:33', '2022-06-24 22:33:22'),
	(111, 1, 'OTHER_EXPENSE', 'Entertainment', 'Use Entertainment to track events to entertain employees.\nIf the event is a meal, use Entertainment meals, instead.', NULL, NULL, '2022-05-16 01:13:57', '2022-06-24 22:33:38'),
	(112, 1, 'OTHER_EXPENSE', 'Entertainment Meals', 'Use Entertainment meals to track how much you spend on dining with your employees to promote morale.\nIf you dine with a customer to promote your business, use a Promotional meals account, instead.\n\nBe sure to include who you ate with and the purpose of the meal when you enter the transaction.', NULL, NULL, '2022-05-16 01:14:36', '2022-06-24 22:33:53'),
	(113, 1, 'OPERATING_EXPENSE', 'Equipment Rental', 'Use Equipment rental to track the cost of renting equipment to produce products or services.\nThis account is also available as a Cost of Goods (COGS) account.\n\nIf you purchase equipment, use a Fixed Asset account type called Machinery and equipment.', NULL, NULL, '2022-05-16 01:14:54', '2022-06-24 22:34:13'),
	(114, 1, 'OVERHEAD_EXPENSE', 'Finance costs', NULL, NULL, NULL, '2022-05-16 01:15:15', '2022-05-16 01:15:15'),
	(115, 1, 'OTHER_EXPENSE', 'Insurance', 'Use Insurance to track insurance payments.\nYou may want different accounts of this type for different types of insurance (auto, general liability, and so on).', NULL, NULL, '2022-05-16 01:15:35', '2022-06-24 22:34:41'),
	(116, 1, 'OTHER_EXPENSE', 'Interest Paid', 'Use Interest paid for all types of interest you pay, including mortgage interest, finance charges on credit cards, or interest on loans.', NULL, NULL, '2022-05-16 01:16:28', '2022-06-24 22:34:54'),
	(117, 1, 'OTHER_EXPENSE', 'Legal & Professional Fees', 'Use Legal & professional fees to track money to pay to professionals to help you run your business.\nYou may want different accounts of this type for payments to your accountant, lawyer, or other consultants.', NULL, NULL, '2022-05-16 01:16:40', '2022-06-24 22:35:17'),
	(118, 1, 'OPERATING_EXPENSE', 'Office/General Administrative Expenses', 'Use Office/general administrative expenses to track all types of general or office-related expenses.', NULL, NULL, '2022-05-16 01:17:11', '2022-06-24 22:35:36'),
	(119, 1, 'OTHER_EXPENSE', 'Other Business Expenses', 'Use Other miscellaneous service cost to track costs related to providing services that don’t fall into another Expense type.\nThis account is also available as a Cost of Goods Sold (COGS) account.', NULL, NULL, '2022-05-16 01:17:25', '2022-06-24 22:35:58'),
	(120, 1, 'OTHER_EXPENSE', 'Other Miscellaneous Service Cost', NULL, NULL, NULL, '2022-05-16 01:17:39', '2022-05-16 01:17:39'),
	(121, 1, 'OVERHEAD_EXPENSE', 'Payroll Expenses', 'Use Payroll expenses to track payroll expenses. You may want different accounts of this type for things like:\nCompensation of officers\nGuaranteed payments\nWorkers compensation\nSalaries and wages\nPayroll taxes', NULL, NULL, '2022-05-16 01:17:59', '2022-06-24 22:36:12'),
	(122, 1, 'OVERHEAD_EXPENSE', 'Payroll Tax Expenses', NULL, NULL, NULL, '2022-05-16 01:18:20', '2022-05-16 01:18:20'),
	(123, 1, 'OVERHEAD_EXPENSE', 'Payroll Wage Expenses', NULL, NULL, NULL, '2022-05-16 01:19:17', '2022-05-16 01:19:17'),
	(124, 1, 'OTHER_EXPENSE', 'Promotional Meals', 'Use Promotional meals to track how much you spend dining with a customer to promote your business.\nBe sure to include who you ate with and the purpose of the meal when you enter the transaction.', NULL, NULL, '2022-05-16 01:19:31', '2022-06-24 22:36:36'),
	(125, 1, 'OPERATING_EXPENSE', 'Rent or Lease of Buildings', NULL, NULL, NULL, '2022-05-16 01:19:42', '2022-05-16 01:19:42'),
	(126, 1, 'OPERATING_EXPENSE', 'Repair & Maintenance', 'Use Repair & maintenance to track any repairs and periodic maintenance fees.\nYou may want different accounts of this type to track different types repair & maintenance expenses (auto, equipment, landscape, and so on).', NULL, NULL, '2022-05-16 01:19:58', '2022-06-24 23:44:38'),
	(127, 1, 'OPERATING_EXPENSE', 'Shipping, Freight & Delivery', 'Use Shipping, freight & delivery to track the cost of shipping products to customers or distributors.\nYou might use this type of account for incidental shipping expenses, and the Cost of Goods Sold type of Shipping, freight & delivery account for direct costs.\n\nThis account is also available as a Cost of Goods Sold account.', NULL, NULL, '2022-05-16 01:20:13', '2022-06-24 23:45:12'),
	(128, 1, 'OPERATING_EXPENSE', 'Supplies & Materials', 'Use Supplies & materials to track the cost of raw goods and parts used or consumed when producing a product or providing a service.\nThis account is also available as a Cost of Goods Sold (COGS) account.', NULL, NULL, '2022-05-16 01:20:31', '2022-06-24 23:45:28'),
	(129, 1, 'OVERHEAD_EXPENSE', 'Taxes Paid', 'Use Taxes paid to track taxes you pay.\nYou may want different accounts of this type for payments to different tax agencies (sales tax, state tax, federal tax).', NULL, NULL, '2022-05-16 01:20:43', '2022-06-24 23:46:10'),
	(130, 1, 'OTHER_EXPENSE', 'Travel', 'Use Travel to track travel costs.\nFor food you eat while traveling, use Travel meals, instead.', NULL, NULL, '2022-05-16 01:20:56', '2022-06-24 23:46:38'),
	(131, 1, 'OTHER_EXPENSE', 'Amortization', 'Use Amortization to track amortization of intangible assets.\nAmortization is spreading the cost of an intangible asset over its useful life, like depreciation of fixed assets.\n\nYou may want an amortization account for each intangible asset you have.', NULL, NULL, '2022-05-16 01:21:23', '2022-06-24 23:49:11'),
	(132, 1, 'OTHER_EXPENSE', 'Depreciation', 'Use Depreciation to track how much you depreciate fixed assets.\nYou may want a depreciation account for each fixed asset you have.', NULL, NULL, '2022-05-16 01:21:38', '2022-06-24 23:49:23'),
	(133, 1, 'OTHER_EXPENSE', 'Exchange Gain or Loss', 'Use Exchange Gain or Loss to track gains or losses that occur as a result of exchange rate fluctuations.', NULL, NULL, '2022-05-16 01:21:53', '2022-06-24 23:49:34'),
	(134, 1, 'OTHER_EXPENSE', 'Gas And Fuel', NULL, NULL, NULL, '2022-05-16 01:22:17', '2022-05-16 01:22:17'),
	(135, 1, 'OTHER_EXPENSE', 'Home Office', NULL, NULL, NULL, '2022-05-16 01:22:28', '2022-05-16 01:22:28'),
	(136, 1, 'OTHER_EXPENSE', 'Homeowner Rental Insurance', NULL, NULL, NULL, '2022-05-16 01:22:40', '2022-05-16 01:22:40'),
	(137, 1, 'OTHER_EXPENSE', 'Mortgage Interest Home Office', NULL, NULL, NULL, '2022-05-16 01:22:54', '2022-05-16 01:22:54'),
	(138, 1, 'OTHER_EXPENSE', 'Other Home Office Expenses', NULL, NULL, NULL, '2022-05-16 01:23:06', '2022-05-16 01:23:06'),
	(139, 1, 'OTHER_EXPENSE', 'Other Miscellaneous Expense', 'Use Other miscellaneous expense to track unusual or infrequent expenses that don’t fall into another Other Expense type.\nIf an expense is directly related to providing a service, use an Expense type (not an Other Expense type) account called Other miscellaneous service cost.', NULL, NULL, '2022-05-16 01:23:18', '2022-06-24 23:50:09'),
	(140, 1, 'OTHER_EXPENSE', 'Other Vehicle Expenses', NULL, NULL, NULL, '2022-05-16 01:23:31', '2022-05-16 01:23:31'),
