	(143, 1, 'OTHER_EXPENSE', 'Other Miscellaneous Expense', NULL, NULL, NULL, '2022-05-16 01:24:08', '2022-05-16 01:24:08'),
	(144, 1, 'OTHER_EXPENSE', 'Other Vehicle Expenses', NULL, NULL, NULL, '2022-05-16 01:24:28', '2022-05-16 01:24:28'),
	(145, 1, 'OTHER_EXPENSE', 'Parking and Tolls', NULL, NULL, NULL, '2022-05-16 01:24:39', '2022-05-16 01:24:39'),
	(146, 1, 'OTHER_EXPENSE', 'Penalties & Settlements', 'Use Penalties & settlements to track money you pay for violating laws or regulations, settling lawsuits, or other penalties.', NULL, NULL, '2022-05-16 01:24:51', '2022-06-24 23:50:25'),
	(147, 1, 'OTHER_EXPENSE', 'Property Tax Home Office', NULL, NULL, NULL, '2022-05-16 01:25:01', '2022-05-16 01:25:01'),
	(148, 1, 'OTHER_EXPENSE', 'Rent and Lease Home Office', 'Use Rent or lease of buildings to track rent payments you make.', NULL, NULL, '2022-05-16 01:25:13', '2022-06-24 23:44:08'),
	(149, 1, 'OTHER_EXPENSE', 'Repairs and Maintenance Home Office', NULL, NULL, NULL, '2022-05-16 01:25:24', '2022-05-16 01:25:24'),
	(150, 1, 'OTHER_EXPENSE', 'Utilities Home Office', NULL, NULL, NULL, '2022-05-16 01:25:35', '2022-05-16 01:25:35'),
	(151, 1, 'OTHER_EXPENSE', 'Vehicle', NULL, NULL, NULL, '2022-05-16 01:25:49', '2022-05-16 01:25:49'),
