	(156, 1, 'OTHER_EXPENSE', 'Vehicle Registration', NULL, NULL, NULL, '2022-05-16 01:26:56', '2022-05-16 01:26:56'),
	(157, 1, 'OTHER_EXPENSE', 'Vehicle Repairs', NULL, NULL, NULL, '2022-05-16 01:27:06', '2022-05-16 01:27:06'),
	(158, 1, 'OTHER_EXPENSE', 'Wash and Road Services', NULL, NULL, NULL, '2022-05-16 01:27:30', '2022-05-16 01:27:30'),
	(159, 1, 'NON_CURRENT_ASSET', 'Accumulated Amortization', 'Use Accumulated amortization to track how much you amortize intangible assets.', NULL, NULL, '2022-06-24 12:15:18', '2022-06-24 12:40:43'),
	(160, 1, 'NON_CURRENT_ASSET', 'Accumulated Depletion', 'Use Accumulated depletion to track how much you deplete a natural resource.', NULL, NULL, '2022-06-24 12:15:44', '2022-06-24 12:41:34'),
	(161, 1, 'NON_CURRENT_ASSET', 'Accumulated Depreciation', 'Use Accumulated depreciation to track how much you depreciate a fixed asset (a physical asset you do not expect to convert to cash during one year of normal operations).', NULL, NULL, '2022-06-24 12:17:04', '2022-06-24 12:41:45'),
	(162, 1, 'NON_CURRENT_ASSET', 'Buildings', 'Use Buildings to track the cost of structures you own and use for your business. If you have a business in your home, consult your accountant or IRS Publication 587.\nUse a Land account for the land portion of any real property you own, splitting the cost of the property between land and building in a logical method. A common method is to mimic the land-to-building ratio on the property tax statement.', NULL, NULL, '2022-06-24 12:17:22', '2022-06-24 12:41:55'),
	(163, 1, 'NON_CURRENT_ASSET', 'Depletable Assets', 'Use Depletable assets to track natural resources, such as timberlands, oil wells, and mineral deposits.', NULL, NULL, '2022-06-24 12:17:43', '2022-06-24 12:42:06'),
	(164, 1, 'NON_CURRENT_ASSET', 'Fixed Asset Computers', NULL, NULL, NULL, '2022-06-24 12:17:54', '2022-06-24 12:17:54'),
	(165, 1, 'NON_CURRENT_ASSET', 'Fixed Asset Copiers', NULL, NULL, NULL, '2022-06-24 12:18:05', '2022-06-24 12:18:05'),
	(166, 1, 'NON_CURRENT_ASSET', 'Fixed Asset Furniture', NULL, NULL, NULL, '2022-06-24 12:18:15', '2022-06-24 12:18:15'),
	(167, 1, 'NON_CURRENT_ASSET', 'Fixed Asset Other Tools Equipment', NULL, NULL, NULL, '2022-06-24 12:18:25', '2022-06-24 12:18:25'),
	(168, 1, 'NON_CURRENT_ASSET', 'Fixed Asset Phone', NULL, NULL, NULL, '2022-06-24 12:18:36', '2022-06-24 12:18:36'),
	(169, 1, 'NON_CURRENT_ASSET', 'Fixed Asset Photo Video', NULL, NULL, NULL, '2022-06-24 12:18:47', '2022-06-24 12:18:47'),
	(170, 1, 'NON_CURRENT_ASSET', 'Fixed Asset Software', NULL, NULL, NULL, '2022-06-24 12:18:57', '2022-06-24 12:18:57'),
	(171, 1, 'NON_CURRENT_ASSET', 'Furniture & Fixtures', 'Use Furniture & fixtures to track any furniture and fixtures your business owns and uses, like a dental chair or sales booth.', NULL, NULL, '2022-06-24 12:19:14', '2022-06-24 12:42:40'),
	(172, 1, 'NON_CURRENT_ASSET', 'Intangible Assets', 'Use Intangible assets to track intangible assets that you plan to amortize. Examples include franchises, customer lists, copyrights, and patents.', NULL, NULL, '2022-06-24 12:19:32', '2022-06-24 12:42:52'),
	(173, 1, 'NON_CURRENT_ASSET', 'Land', 'Use Land for land or property you don’t depreciate.\nIf land and building were acquired together, split the cost between the two in a logical way. One common method is to use the land-to-building ratio on the property tax statement.\n\nFor land you use as a natural resource, use a Depletable assets account, instead.', NULL, NULL, '2022-06-24 12:19:49', '2022-06-25 02:03:09'),
	(174, 1, 'NON_CURRENT_ASSET', 'Leasehold Improvements', 'Use Leasehold improvements to track improvements to a leased asset that increases the asset’s value. For example, if you carpet a leased office space and are not reimbursed, that’s a leasehold improvement.', NULL, NULL, '2022-06-24 12:20:07', '2022-06-24 12:43:18'),
	(175, 1, 'NON_CURRENT_ASSET', 'Machinery & Equipment', 'Use Machinery & equipment to track computer hardware, as well as any other non-furniture fixtures or devices owned and used for your business.\nThis includes equipment that you ride, like tractors and lawn mowers. Cars and trucks, however, should be tracked with Vehicle accounts, instead.', NULL, NULL, '2022-06-24 12:20:22', '2022-06-24 12:43:29'),
	(176, 1, 'NON_CURRENT_ASSET', 'Other fixed assets', 'Use Other fixed asset for fixed assets that are not covered by other asset types.\nFixed assets are physical property that you use in your business and that you do not expect to convert to cash or be used up during one year of normal operations.', NULL, NULL, '2022-06-24 12:20:41', '2022-06-24 12:43:44'),
	(177, 1, 'NON_CURRENT_ASSET', 'Vehicles', 'Use Vehicles to track the value of vehicles your business owns and uses for business. This includes off-road vehicles, air planes, helicopters, and boats.\nIf you use a vehicle for both business and personal use, consult your accountant or the IRS to see how you should track its value.', NULL, NULL, '2022-06-24 12:20:57', '2022-06-24 12:43:54'),
	(178, 1, 'CONTRA_ASSET', 'Organizational Costs', NULL, NULL, '2022-06-24 12:39:18', '2022-06-24 12:23:14', '2022-06-24 12:39:18'),
	(179, 1, 'CONTRA_ASSET', 'Other Long-term Assets', 'Use Other long-term assets to track assets not covered by other types.\nLong-term assets are expected to provide value for more than one year', NULL, NULL, '2022-06-24 12:23:33', '2022-06-24 12:39:46'),
	(180, 1, 'CONTRA_ASSET', 'Allowance for Bad Debts', 'Use Allowance for bad debts to estimate the part of Accounts receivable you think you might not collect.\nUse this only if you are keeping your books on the accrual basis.', NULL, NULL, '2022-06-24 12:45:18', '2022-06-24 12:45:18'),
	(181, 1, 'CONTRA_ASSET', 'Development Costs', 'Use Development costs to track amounts you deposit or set aside to arrange for financing, such as an SBA loan, or for deposits in anticipation of the purchase of property or other assets.\nWhen the deposit is refunded, or the purchase takes place, remove the amount from this account.', NULL, NULL, '2022-06-24 12:45:44', '2022-06-24 12:45:44'),
	(182, 1, 'CONTRA_ASSET', 'Employee Cash Advances', 'Use Employee cash advances to track employee wages and salary you issue to an employee early, or other non-salary money given to employees.\nIf you make a loan to an employee, use the Other current asset account type called Loans to others, instead.', NULL, NULL, '2022-06-24 12:46:20', '2022-06-24 12:46:20'),
	(183, 1, 'INVENTORY', 'Inventory', 'Use Inventory to track the cost of goods your business purchases for resale.\nWhen the goods are sold, assign the sale to a Cost of goods sold account.', NULL, NULL, '2022-06-24 12:46:48', '2022-06-25 01:05:19'),
	(184, 1, 'CONTRA_ASSET', 'Investment - Mortgage/Real Estate Loans', 'loans to show the balances of any mortgage or real estate loans your business has made or purchased.', NULL, NULL, '2022-06-24 12:47:07', '2022-06-24 12:47:07'),
	(185, 1, 'CONTRA_ASSET', 'Investment - Tax-Exempt Securities', 'Use Investments - Tax-exempt securities for investments in state and local bonds, or mutual funds that invest in state and local bonds.', NULL, NULL, '2022-06-24 12:47:22', '2022-06-24 12:47:22'),
	(186, 1, 'CONTRA_ASSET', 'Investments - Other', 'Use Investments - Other to track the value of investments not covered by other investment account types. Examples include publicly-traded stocks, coins, or gold.', NULL, NULL, '2022-06-24 12:47:48', '2022-06-24 12:47:48'),
	(187, 1, 'CONTRA_ASSET', 'Loans To Officers', 'If you operate your business as a Corporation or S Corporation, use Loans to officers to track money loaned to officers of your business.', NULL, NULL, '2022-06-24 12:48:49', '2022-06-24 12:48:49'),
	(188, 1, 'CONTRA_ASSET', 'Loans to Others', 'Use Loans to others to track money your business loans to other people or businesses.\nThis type of account is also referred to as Notes Receivable.\n\nFor early salary payments to employees, use Employee cash advances, instead.', NULL, NULL, '2022-06-24 12:49:32', '2022-06-24 12:49:32'),
	(189, 1, 'CONTRA_ASSET', 'Loans to Stockholders', 'If you operate your business as a Corporation or S Corporation, use Loans to stockholders to track money your business loans to its stockholders.', NULL, NULL, '2022-06-24 12:49:55', '2022-06-24 12:49:55'),
	(190, 1, 'CONTRA_ASSET', 'Other Current Assets', 'Use Other current assets for current assets not covered by the other types. Current assets are likely to be converted to cash or used up in a year.', NULL, NULL, '2022-06-24 12:50:12', '2022-06-24 12:50:12'),
	(191, 1, 'CURRENT_ASSET', 'Prepaid Expenses', 'Use Prepaid expenses to track payments for expenses that you won’t recognize until your next accounting period.\nWhen you recognize the expense, make a journal entry to transfer money from this account to the expense account.', NULL, NULL, '2022-06-24 12:50:42', '2022-06-25 02:07:53'),
	(192, 1, 'CURRENT_ASSET', 'Retainage', 'Use Retainage if your customers regularly hold back a portion of a contract amount until you have completed a project.\nThis type of account is often used in the construction industry, and only if you record income on an accrual basis.', NULL, NULL, '2022-06-24 12:50:57', '2022-06-25 02:03:54'),
	(193, 1, 'CURRENT_ASSET', 'Undeposited Funds', 'Use Undeposited funds for cash or checks from sales that haven’t been deposited yet.\nFor petty cash, use Cash on hand, instead.', NULL, NULL, '2022-06-24 12:51:13', '2022-06-25 02:18:28'),
	(194, 1, 'OTHER_EXPENSE', 'Travel Meals', 'Use Travel meals to track how much you spend on food while traveling.\nIf you dine with a customer to promote your business, use a Promotional meals account, instead.\n\nIf you dine with your employees to promote morale, use Entertainment meals, instead.', NULL, NULL, '2022-06-24 23:47:18', '2022-06-24 23:47:18'),
	(195, 1, 'OTHER_EXPENSE', 'Unapplied Cash Bill Payment Expense', 'Unapplied Cash Bill Payment Expense reports the Cash Basis expense from vendor payment checks you’ve sent but not yet applied to vendor bills. In general, you would never use this directly on a purchase or sale transaction. See IRS Publication 538.', NULL, NULL, '2022-06-24 23:47:58', '2022-06-24 23:47:58'),
	(196, 1, 'OTHER_EXPENSE', 'Utilities', 'Use Utilities to track utility payments.\nYou may want different accounts of this type to track different types of utility payments (gas and electric, telephone, water, and so on).', NULL, NULL, '2022-06-24 23:48:39', '2022-06-24 23:48:39'),
	(197, 1, 'CURRENT_ASSET', 'Cash', NULL, NULL, NULL, '2022-06-25 10:40:14', '2022-06-25 10:40:14'),
	(198, 1, 'INVENTORY', 'Raw Materials Inventory', NULL, NULL, NULL, '2022-08-04 15:54:55', '2022-08-04 15:54:55'),
	(199, 1, 'INVENTORY', 'Finished Goods Inventory', NULL, NULL, NULL, '2022-08-04 15:55:23', '2022-08-04 15:55:23'),
	(200, 1, 'PAYABLE', 'Wages Payable', NULL, NULL, NULL, '2022-08-04 17:28:50', '2022-08-04 17:28:50');
